"""
Max Consecutive Ones III

Given a binary array nums and an integer k, return the maximum number of consecutive 1's in the array if you can flip at most k 0's.
"""

from collections import deque
class Solution:
    def longestOnesBad(self, nums, k):
        streaks = []
        max_streak = 0
        unflipped_streak = 0
        for i in range(len(nums)):
            if nums[i] == 0:
                j = 0
                while j < len(streaks):
                    if streaks[j][1] <= 0:
                        if streaks[j][0] > max_streak:
                            max_streak = streaks[j][0]
                        streaks.pop(0)
                    else:
                        streaks[j][1] -= 1
                        streaks[j][0] += 1
                        j += 1
                if k > 0:
                    streaks.append([unflipped_streak+1, k-1])
                unflipped_streak = 0
            else:
                if unflipped_streak == 0:
                    streaks.append([unflipped_streak, k])
                unflipped_streak += 1
                for j in range(len(streaks)):
                    streaks[j][0] += 1

        for i in range(len(streaks)):
            if streaks[i][0] > max_streak:
                max_streak = streaks[i][0]

        return max_streak

    def longestOnes(self, nums, k):
        window = deque()
        max_streak = 0
        count = 0
        for i in range(len(nums)):
            if not(nums[i]):
                count += 1
                if count > k:
                    while window and window.popleft():
                        continue
                if k > 0:
                    window.append(nums[i])
            else:
                window.append(nums[i])
            
            if len(window) > max_streak:
                max_streak = len(window)
        return max_streak


